class ValidationRule:
    def __init__(self, rule_id: str, description: str, error_message: str):
        self.rule_id = rule_id
        self.description = description
        self.error_message = error_message

class FABSSubmission:
    def __init__(self, submission_id: str, agency_code: str, user_id: str):
        self.submission_id = submission_id
        self.agency_code = agency_code
        self.user_id = user_id
        self.publish_status = PublishStatus.UNPUBLISHED
        self.created_at = datetime.now()
        self.updated_at = datetime.now()
        self.validation_errors: List[str] = []
        self.flex_fields: Dict[str, str] = {}

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.updated_at = datetime.now()
        logger.info(f"Submission {self.submission_id} status changed to {new_status}")

    def add_validation_error(self, error: str):
        self.validation_errors.append(error)

    def get_validation_errors(self) -> List[str]:
        return self.validation_errors

    def add_flex_field(self, name: str, value: str):
        self.flex_fields[name] = value

